import React from 'react';
import axios from 'axios';


class VideoList extends React.Component {
    constructor(props) {
        super();
        this.state = {
            videos: [],
        };
    }

    componentDidMount() {
        axios.get('http://localhost:3000/video')
        .then(res => {
                this.setState({videos:res.data});
        })
    }

    render() {
        return(
            <div>
                Hello
            </div>
        );
    }
}

export default VideoList;
